import {useEffect} from 'react'

function FetchEMA20Calculation({stockCode, onEMA20CalculationFetch}) {
    useEffect(() => {
        if(stockCode) {
            fetch(`http://127.0.0.1:8000/api/calculation_ema20/${stockCode}/`)
                .then(response => response.json())
                .then(data => {if(onEMA20CalculationFetch) onEMA20CalculationFetch(data)})
                .catch(error => console.error('Error Stock Data:', error));
        }
    }, [stockCode]);
    return null;
}
export default FetchEMA20Calculation;
